import { Link } from 'react-router-dom'
import AllOuslets from "../components/dashboard/AllOuslets";
import SaleToday from "../components/dashboard/SaleToday"
import Feeds from "../components/dashboard/Feeds";
import ProjectTables from "../components/dashboard/ProjectTable";

import Blog from "../components/dashboard/Blog";
import bg1 from "../assets/images/bg/bg1.jpg";
import bg2 from "../assets/images/bg/bg2.jpg";
import bg3 from "../assets/images/bg/bg3.jpg";
import bg4 from "../assets/images/bg/bg4.jpg";

import {
  Card,
  CardText,
  CardBody,
  CardTitle,
  Row,
  Col,
} from "reactstrap";

const BlogData = [
  {
    image: bg1,
    title: "This is simple blog",
    subtitle: "2 comments, 1 Like",
    description:
      "This is a wider card with supporting text below as a natural lead-in to additional content.",
    btnbg: "primary",
  },
  {
    image: bg2,
    title: "Lets be simple blog",
    subtitle: "2 comments, 1 Like",
    description:
      "This is a wider card with supporting text below as a natural lead-in to additional content.",
    btnbg: "primary",
  },
  {
    image: bg3,
    title: "Don't Lamp blog",
    subtitle: "2 comments, 1 Like",
    description:
      "This is a wider card with supporting text below as a natural lead-in to additional content.",
    btnbg: "primary",
  },
  {
    image: bg4,
    title: "Simple is beautiful",
    subtitle: "2 comments, 1 Like",
    description:
      "This is a wider card with supporting text below as a natural lead-in to additional content.",
    btnbg: "primary",
  },
];

const Starter = () => {
  return (
    <div>

      <Row>
        <Col sm="6" lg="6">
          {/* <Feeds /> */}
          <div>
            <h5>Hi, here’s what’s happening in your stores</h5>
          </div>
          <div>
            <h5>Today your stores have sold SR40.00</h5>
          </div>
          <div>
            <h6>That’s SR40.00 more than this time last Saturday!</h6>
          </div>
        </Col>
        <Col sm="6" lg="6">
          <AllOuslets />
        </Col>
      </Row>

      <Card body>
        <Row>
          <Col sm="6" lg="6" xl="6" xxl="6">
              <CardTitle tag="h5">Your Sale Target</CardTitle>
              <CardBody>
                <div>
                  <div>SR400</div>
                  <Link to="">Set a Sales Target</Link>
                </div>
                <Row>
                  <Col lg="6">
                    <h6>Average Sale Value</h6>
                    <div>SR400</div>
                    <h6>SR400 more than last Saturday</h6>
                  </Col>
                  <Col lg="6">
                    <h6>Average Item Per Sale</h6>
                    <div>1</div>
                    <h6>1 more than last Saturday</h6>
                  </Col>
                </Row>
              </CardBody>
          </Col>
          <Col sm="6" lg="6" xl="6" xxl="6">
            <SaleToday />
          </Col>
        </Row>
      </Card>
        
      {/***Blog Cards***/}
      <Row>
        {BlogData.map((blg, index) => (
          <Col sm="6" lg="6" xl="3" key={index}>
            <Blog
              image={blg.image}
              title={blg.title}
              subtitle={blg.subtitle}
              text={blg.description}
              color={blg.btnbg}
            />
          </Col>
        ))}
      </Row>
    </div>
  );
};

export default Starter;
